import React, {useState} from 'react'
import {Wrapper, H1} from '../Styled';
import Input from './Input'

import styled from "styled-components";

const Container = styled(Wrapper)`
    min-height:80vh;
`

const Form = styled.form`
    border: 2px solid var(--s-3);
    border-radius:.5em;
    padding:1em;
    max-width:40em;
    margin:0 auto;
`

export default function Contact() {
    const [name, setName] = useState('')
    const [eMail, setEMail] = useState('')
    const [message, setMessage] = useState('')

    return (
        <Container>
            <H1>Contact</H1>
            <Form>
                <Input label='Name' value={name} setValue={(e) => {setName(e); console.log('set')}} />
                <Input label='E-Mail' value={eMail} setValue={setEMail} />
                <Input label='Message' value={message} setValue={setMessage} />
                <button></button>
            </Form>
            <H1>{name}</H1>
        </Container>
    )
}
